import React from 'react'
import { Field, reduxForm } from 'redux-form';
import {Input, Button} from '@material-ui/core';

class AirportForm extends React.Component {
  handleSubmit = (e, data) => {
    e.preventDefault();
    this.props.onSubmit(e);
  }

  handleCancel = () => {
    this.props.onCancel();
  }
  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <Input placeholder='Name' name='name'/>
        <Input placeholder='Country' name='country'/>
        <Input placeholder='Location' name='location'/>
        <Input placeholder='Departing from' name='departingFrom'/>
        <Input placeholder='Landing to' name='landingTo'/>
        <Button type='submit' color='primary' variant='contained'>Submit</Button>
        <Button variant='contained' onClick={this.handleCancel}>Cancel</Button>
      </form>
    )
  }
}

export default reduxForm({form: 'airport'})(AirportForm);
